import React from 'react';
import logo from './logo.svg';
import './App.css';
import Router from './util/Router';
import { Route } from 'react-router-dom';
import HomeScreen from './pages/HomeScreen';

function App() {
  return (
    
        <Router>
          <Route path="/" component={HomeScreen} />
        </Router>
    
  );
}

export default App;
